import React from 'react';
import './App.css';
import Square from './Items/Square/Square';
import Elipse from './Items/Elipse/Elipse';
import Main from './Items/Calculator/Main/Main';
import Circle from './Items/Circle/Circle';
export default function App(){

   return(
       <>
          <div className="container">
              <Square  />
              <div className="box-top">
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> 
              </div>
              <div className="box-bottom">
                  <Elipse /> 
                  <Elipse /> 
                  <Elipse /> <Elipse />  <Elipse /> <Elipse /> <Elipse /> <Elipse />  <Elipse /> 
              </div>
              <Main />
              <Circle />
          </div>
       </>
   )

}
